/// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


contract WheelSolo is Ownable {

    using SafeMath for uint256;
    using Address for address;

    // States of the game.
    enum States {
        NOTSTARTED,     // Round hasn't started yet.
        BETTING,        // Smart contract is open for placing bets.
        IDLE,           // Smart contract is restricted to do any other acitivites than waiting.
        COMPLETED       // Smart contract transfers the prizes & resets variables.
    }

    States public state; // Current state of the game.

    IERC20 internal _LLTH; // Instance of $LLTH token.

    uint256 public minMultiplier; // Minimum value of the wheel segment multiplier.
    uint256 public maxMultiplier; // Maximum value of the wheel segment multiplier.
    uint256 internal _winningMultiplier; // Random winning multiplier number.
    uint256 internal _creationTime; // Time of starting a new round.
    uint256 internal _bettingTime; // Duration of betting in seconds.
    uint256 internal _idleTime; // Duration of spinning in seconds.

    address[] public players; // Array of players in the current round.

    mapping(address => uint256) bets; // Bets of players in the current round.
    mapping(address => uint256) multipliers; // Multiplier of players in the current round.


    //-------------------------------------------------------------------------
    // CONSTRUCTOR
    //-------------------------------------------------------------------------

    constructor(uint256 minMultiplier_, uint256 maxMultiplier_, uint256 bettingTime_, uint256 idleTime_) {
        minMultiplier = minMultiplier_;
        maxMultiplier = maxMultiplier_;
        _bettingTime = bettingTime_;
        _idleTime = idleTime_;
        state = States.NOTSTARTED;
    }

    //-------------------------------------------------------------------------
    // STATE MODIFIERS
    //-------------------------------------------------------------------------

    modifier atState(States _state) {
        require(
            state == _state,
            "Function cannot be called at this time."
        );
        _;
    }

    modifier timedTransitions() {
        if (state == States.BETTING &&
                    block.timestamp >= _creationTime + _bettingTime)
            state = States.IDLE;
        if (state == States.IDLE &&
                block.timestamp >= _creationTime + _idleTime)
            state = States.COMPLETED;
        _;
    }


    //-------------------------------------------------------------------------
    // VIEW FUNCTIONS
    //-------------------------------------------------------------------------

    function getState() external view returns(States) {
        return state;
    }

    //-------------------------------------------------------------------------
    // SET FUNCTIONS
    //-------------------------------------------------------------------------


    //-------------------------------------------------------------------------
    // INTERNAL FUNCTIONS 
    //-------------------------------------------------------------------------

    function random(uint256 mod) view internal returns(uint256) {
        return uint256(keccak256(abi.encodePacked(block.timestamp, block.difficulty))) % mod;
    }

    function getWinningMultiplier() internal {
        _winningMultiplier = random(25);
    }

    // Transfers the prize for winners, resets mappings and array.
    function closeRound() internal atState(States.COMPLETED) {
        for (uint256 i = 0; i < players.length; i++) {
            if (multipliers[players[i]] == _winningMultiplier) {
                _LLTH.transfer(players[i], _winningMultiplier.mul(bets[players[i]]));
            }
            delete multipliers[players[i]];
            delete bets[players[i]];
        }
        delete players;
        state = States.NOTSTARTED;
    }


    //-------------------------------------------------------------------------
    // EXTERNAL FUNCTIONS 
    //-------------------------------------------------------------------------

    function startNewRound(uint256 startTime) external atState(States.NOTSTARTED) onlyOwner() {
        require(block.timestamp >= startTime);
        state = States.BETTING;
    }

    function placeBet(uint256 bet, uint256 multiplier) external timedTransitions() atState(States.BETTING) {
        players.push(msg.sender);
        bets[msg.sender] = bet;
        multipliers[msg.sender] = multiplier;   
    }


}
